package instructions

import (
	"encoding/base64"
	"testing"

	"github.com/near/borsh-go"
)

func TestNewNebulaContract(t *testing.T) {
	dataBase64 := ``
	data, err := base64.StdEncoding.DecodeString(dataBase64)
	if err != nil {
		t.Log(err)
		t.FailNow()
	}
	n := NewNebulaContract()
	err = borsh.Deserialize(&n, data)

	if err != nil {
		t.Log(err)
		t.FailNow()
	}
}
